import 'package:flutter_app2/models/products/products_model.dart';class CategoryWithProductsModel{  List<HomePageCategoryWithProducts> list;  CategoryWithProductsModel(this.list);  factory CategoryWithProductsModel.fromJson(Map<String,dynamic> json){    return CategoryWithProductsModel(List.from(json['HomePageCategory']).map((item)=>        HomePageCategoryWithProducts.fromJson(item)).toList());  }}class HomePageCategoryWithProducts{  String id;  String imageURL;  String name;  List<ProductModel> products;  HomePageCategoryWithProducts(      this.id, this.imageURL, this.name, this.products);  factory HomePageCategoryWithProducts.fromJson(Map<String,dynamic> json){    return HomePageCategoryWithProducts(json['Id'],json['ImageURL'],        json['Name'],List.from(json['Products']).map((item)=>ProductModel.fromJson(item)).toList());  }}